import React from "react";
import { useNavigate } from "react-router-dom";
import { mainStyle, cardStyle, subtitleStyle, buttonStyle } from "./styles";

import { accentColor } from "./styles";

function Home() {
  const navigate = useNavigate();
  return (
    <div style={{...mainStyle, justifyContent: "center", alignItems: "center", display: "flex"}}>
      <div style={{...cardStyle, margin: "0 auto", display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "center"}}>
        <div style={{ width: "100%", display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "center", marginBottom: "18px" }}>
          <span style={{
            fontSize: "5.2rem",
            marginBottom: "18px",
            color: accentColor,
            filter: `drop-shadow(0 0 12px ${accentColor}) drop-shadow(0 0 24px #23d6c5)`
          }}>ðŸ§­</span>
          <h1
            style={{
              color: accentColor,
              textShadow: `0 4px 32px ${accentColor}88, 0 0px 60px #070F2B`,
              letterSpacing: "6px",
              textTransform: "uppercase",
              margin: 0,
              textAlign: "center"
            }}
          >
            Mental Health Compass
          </h1>
        </div>
        <p style={{...subtitleStyle, fontSize: "1.35rem", color: accentColor, textShadow: `0 1px 8px ${accentColor}55`, fontWeight: 700, textAlign: "center", marginBottom: "32px"}}>Your guide to a healthier mind</p>
        <button style={{...buttonStyle, fontSize: "2.2rem", background: `linear-gradient(90deg, ${accentColor} 0%, #6ec6ff 100%)`, color: "#070F2B", alignSelf: "center", padding: "38px 90px"}} onClick={() => navigate("/options")}> 
          <span style={{fontSize: "1.3rem", marginRight: "8px"}}>ðŸš€</span> Get Started
        </button>
      </div>
    </div>
  );
}

export default Home;
